import logo from './logo.svg';
import './App.css';
import Person from './Person/Person';
import React, { Component } from 'react';

class App extends Component {
  state = {
    persons: [
      { name: "Nico", age: 23 },
      { name: "Don", age: 53 },
      { name: "Lol", age: 43 },
      { name: "Heh", age: 33 },
    ],
    otherState : 'Nesto drugo'
  }

  switchNameHandler = (newName) => {
    // console.log("was clicked!");
    // this.state.persons[0].name = "Nikolaj";
    this.setState({
      persons: [
        { name: newName, age: 23 },
        { name: "Don", age: 53 },
        { name: "Lol", age: 43 },
        { name: "Heh", age: 69 },
      ]
    })
  }

