  }

  render() {
    return (
      <div className="App">
        <h1>Hi , im starting up.</h1>
        <h1>lolcina</h1>
        <button onClick={ ()=> this.switchNameHandler("Nikolaj!")}>Switch name</button>
        <Person 
          name={this.state.persons[0].name} age={this.state.persons[0].age} />
        <Person 
          name={this.state.persons[1].name} age={this.state.persons[1].age} />
        <Person 
          name={this.state.persons[2].name} age={this.state.persons[2].age} />
        <Person 
          name={this.state.persons[3].name} age={this.state.persons[3].age} click = {this.switchNameHandler.bind(this, "Nico!!")}>Moj hobi je ojsaaa!</Person>
      </div>
    );
  }
}

export default App;
